'[<emoji document_id=5461040020531980153>❤️</emoji>] ꤎ ઞꤌωё𐌻 ઞ꤀ꤐખ꤇ ꤍꤙ꤀ꤍ꤀ꤒ ꤣꤍꤙ꤀𐌻𑀨उ꤀ꤐꤌઞꤣꤎ ተꤐ꤀ꤕ꤇ 𐌼ꤌተꤕрꤣ, ꤎ ተꤕꤙꤕр𑀨 ꤐꤕωꤌળ ꤕё उꤌ𐌼ꤕꤍተ꤀ ꤐખӄ𐌻ળપꤌተꤕ𐌻ꤎ, ꤣ 𑀋γꤎрળ 𑀋γꤕ𐌼 ꤙ꤀ ꤙꤣउმꤕ ተꤐ꤀ꤕ꤇ 𐌼ꤌተꤕрꤣ, ꤣ ꤍрꤌउγ 𐌟ꤕ ꤐӄ𐌻ળપꤌꤕተꤍꤎ ꤍꤐꤕተ ꤐ ӄ꤀𐌼ઞꤌተꤕ) [<emoji document_id=5461040020531980153>❤️</emoji>]',
'[<emoji document_id=5461040020531980153>❤️</emoji>] ӄꤍተꤌተꤣ ተꤐ꤀ꤎ 𐌼ꤌተ𑀨 ꤒꤕрꤕተ 𐌼꤀꤇ 𑀋γ꤇ ꤐ рγӄγ ꤣ ꤀рꤕተ "𑀗𐌻ꤌꤐꤌ 𐍅ӄрꤌꤣઞꤕ" [<emoji document_id=5461040020531980153>❤️</emoji>]',
'[<emoji document_id=5461040020531980153>❤️</emoji>] ተꤐ꤀ꤎ 𐌼ꤌተ𑀨 ӄ꤀꤅მꤌ ꤍ꤀ꤍёተ 𐌼꤀꤇ પ𐌻ꤕઞ, ꤍрꤌउγ ઞꤌપꤣઞꤌꤕተ მꤌꤐꤣተꤍꤎ ꤙ꤀પꤕ𐌼γ, ꤀მઞꤌ𐌟მખ ꤕ꤇ ꤙрꤣω𐌻꤀ꤍ𑀨 उꤌωꤣꤐꤌተ𑀨 ꤅꤀𐌻꤀ꤐγ, ꤙ꤀ꤍ𐌻ꤕ ተ꤀꤅꤀ ӄꤌӄ ꤎ ꤍ𐌻γપꤌ꤇ઞ꤀ ꤙр꤀ꤒꤣ𐌻 ꤕ꤇ उꤌተખ𐌻꤀ӄ 𑀋γꤕ𐌼 ӄ꤀꤅მꤌ ꤀ઞꤌ 𐌼꤀꤇ પ𐌻ꤕઞ ꤍ꤀ꤍꤌ𐌻ꤌ ) [<emoji document_id=5461040020531980153>❤️</emoji>]',
