'[<emoji document_id=5461040020531980153>❤️</emoji>] ઞγ ꤙр꤀ꤍተ꤀ ꤎ ꤐપꤕрꤌ ઞꤌꤍꤍꤌ𐌻 ઞꤌ ꤙꤣउმγ ተꤐ꤀ꤕ꤇ 𐌼ꤌተꤕрꤣ ꤣ 𐌼ઞꤕ ӄꤌ𐌟ꤕተꤍꤎ પተ꤀ ꤒрꤌተꤣӄꤌ γ ተꤕꤒꤎ ઞꤕ ꤒγმꤕተ ꤣꤒ꤀ ꤎ ꤕ꤅꤀ उꤌተꤙꤣ𐌻?? [<emoji document_id=5461040020531980153>❤️</emoji>]',
'[<emoji document_id=5461040020531980153>❤️</emoji>] ઞγ ተખ ꤙ꤀ઞꤣ𐌼ꤌꤕω𑀨 પተ꤀ ӄ꤀꤅მꤌ ተꤐ꤀ꤎ 𐌼ꤌተ𑀨 ꤍ𐌻γωꤌꤕተ Ա꤀ꤎ "उꤐꤕउმꤌ ꤙ꤀ ꤣ𐌼ꤕઞꤣ ꤍ꤀𐌻ઞꤟꤌ" ተ꤀ ꤀ઞꤌ ꤙрꤕმꤍተꤌꤐ𐌻ꤎꤕተ 𐌼꤀꤇ 𑀋γ꤇ ઞꤌმ ꤍꤐ꤀ꤕ꤇ ꤙꤣउმ꤀꤇ ӄ꤀ተ꤀рખ꤇ ꤍꤐꤕተꤣተ ꤍꤕꤐꤕрઞખ𐌼 ꤍꤣꤎઞꤣꤕ𐌼? ( [<emoji document_id=5461040020531980153>❤️</emoji>]',
